import React from 'react'
import InventoryRecord from './InventoryRecord';
import InventoryList from './InventoryList'

const App = () => {
    return <div className='container-sm'>
        <h1>Create an inventory record</h1>
        <InventoryRecord />
        <hr />
        <h1>All Inventory Records</h1>
        <InventoryList />
    </div>;
}

export default App;
